INSERT INTO `COURSE` VALUES (96,95,'Main Course','modifiedrogaine',0,0,'<div class=\"listhdr\">\r\n	Race Overview</div>\r\n<ul class=\"simple\">\r\n	<li>\r\n		The race is divided into three sections: Bike Section. consisting of points B1-B8, East Trek consisting of ET1-ET3 and West Trek consisting of WT1-WT6.</li>\r\n	<li>\r\n		The race starts and finishes at labeled S/F.</li>\r\n	<li>\r\n		<span style=\"font-weight: bold;\">Race cutoff is 12 hours 9:30pm.</span> Teams must be back at the start/finish by 9:30pm arriving after this time will result in DQ</li>\r\n	<li>\r\n		All maps are pre plotted and optional east trek UTM coordinates will be provided.</li>\r\n	<li>\r\n		After finishing the course either full or part you must either check out with the volunteer in S/F area or sign out on the provided spreadsheet.</li>\r\n	<li>\r\n		For sections WT and ET all racers must sign in/out with times and report number of checkpoints retrieved</li>\r\n</ul>\r\n<div class=\"listhdr\">\r\n	Section Order</div>\r\n<ul class=\"simple\">\r\n	<li>\r\n		Teams can complete all sections in any order. However, once a team starts a section, they need to .finish. that section . meaning to get as many points as they want within that section -- before moving on to the next section. Once a team finishes a section, they can.t go back later and punch points on a section they.ve finished. Teams can.t punch CPs from a section other than the one they are working on at that time.</li>\r\n</ul>\r\n<div class=\"listhdr\">\r\n	Control Point Order</div>\r\n<ul class=\"simple\">\r\n	<li>\r\n		Rogaine format so any order you choose in the designated section.</li>\r\n</ul>\r\n<div class=\"listhdr\">\r\n	Additional Details</div>\r\n<ul class=\"simple\">\r\n	<li>\r\n		Bikes are mandatory on the bike section and no bikes are allowed on the trek sections, All points are either on right off the trail/FS road or easily accessible from it. You may drop your bike at any place to retrieve a bike CP.</li>\r\n	<li>\r\n		Absolutely no bikes on or around the Appalachian or Benton MacKaye trails.</li>\r\n	<li>\r\n		If going for the optional east trek bikes must be dropped at B4, after dropping bikes you may then start the east trek after either checking in w/ the volunteer or signing in on the provided spreadsheet. Each team must also check out in the same manner stating the number of CP.s retrieved either to the volunteer or in the provided space on the spreadsheet.</li>\r\n	<li>\r\n		The west trek must be started and finished at the start/finish location for the race. You must check in/out with the volunteer and you must state the number of CP.s retrieved or if the volunteer is not on site the provided spreadsheet must be filled in by each team.</li>\r\n	<li>\r\n		There are no off-limits areas on the course, and the bike trails can be ridden in either direction. Be watchful for other riders as the trails are extremely popular, for good reason! Always yield to horse riders. Feel free to bushwhack or bike whack wherever you see fit with the exception of the AT and BMT where no bikes are allowed but bushwhacking is.</li>\r\n	<li>\r\n		Teams can use the Start/Finish location as a transition area which they can visit at any time during the race. That includes while in the middle of working on a race section.</li>\r\n	<li>\r\n		Use your trail map along with the topographic map to determine how to best get around.</li>\r\n	<li>\r\n		There&#39;s plenty of water out there. Be sure to treat it before drinking, but you.ll have plenty of opportunities to fill up your water bottles.</li>\r\n</ul>\r\n','10895','default','default','default','default','default','default','no'),(175,174,'Race Course','stage',24,110,'<p>\r\n	<span style=\"font-size: 36px;\"><u><strong>ROC Gear Stage One</strong><br />\r\n	</u></span></p>\r\n<div>\r\n	One member of each team will&nbsp;run&nbsp;a prologue up to the reflection pond, where they can reflect on how tough it&#39;s going to be getting to the top of the falls, where they will pick up their bikes.&nbsp; After convincing their teammates, that they can indeed make it to the top of the falls, they will make their way up to the bikes. For some, this will be their first trek up the infamous Amicalola Falls stairs, for others, a reminder of last year&#39;s cruel, surprise ending.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Once at the top of the falls, they will transition to the bike portion of the race, a 15.5 mile ride with 1900 ft of elevation gain and 2700 feet of downhills.&nbsp; They will visit the less known Bearden Falls along the way, where they will likely get their feet wet...once or twice.</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Upon arriving at Nimblewill Church and the entrance to the Bull/Jake <span class=\"il\">Mountain</span> Trail Complex, they will have to decide which 4 of the 5 checkpoints they will get.&nbsp; Most will have decided the night before, but many will be discovering that the 15.5 miles of biking were no picnic.&nbsp; Some will be looking at their watches to determine if they will be able to make the canoe put-in cut-off.&nbsp; Missing the cutoff will be a race ending mistake.&nbsp; Many will have to skip some CPs in the Bull Mt area in order to make it to the canoe put-in ahead of the cut-off.&nbsp; After 11-15 miles and 1500-1800 ft of elevation gain/loss, depending on their route choices, they will return to Nimblewill Church, pedalling hard to make that canoe cut-off, but the bike leg isn&#39;t over at Nimblewill Church.&nbsp; They still have around 11 miles and 800 feet of elevation gain to get to the canoe put-in...and if it&#39;s rained recently, this can be a very muddy section, which takes much longer than estimates!</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Arriving at the canoe put-in, no doubt, covered in mud, they will find their canoes and go through a mandatory, spot gear check for safety items before starting the long 23 mile paddle down the Etowah.&nbsp; They will encounter several class II rapids and portage the class IV Etowah Falls in the first 45 minutes to an hour of paddling.&nbsp; After punching the manned checkpoint at Castleberry Bridge, they will continue to the mysterious, if not frightening, quarter mile long Etowah River mining tunnel.&nbsp; They can chose to take the 3 minute ride through the tunnel, or opt to paddle around the bend, which can take 15 minutes or longer.&nbsp; After the tunnel, and their hearts return to their normal pace, they will continue on a much more calm river, through the pasture lands of the piedmont to the canoe takeout.&nbsp;</div>\r\n<div>\r\n	&nbsp;</div>\r\n<div>\r\n	Arriving at the takeout, racers will discover just how stiff they have become, as they struggle to stand and get their canoe out of the river.&nbsp; They will have about&nbsp;two miles to loosen up, as they hike to the end of ROC Gear Stage 1 at the Dawson Forest City Tract parking lot, where the clock will stop, as we wait for midnight. &nbsp;They will have all the comforts they chose to pack for the gear drop and maybe we&#39;ll have a surprise or two for them as well.</div>\r\n<p>\r\n	<br />\r\n	<object height=\"400\" width=\"711\"><param name=\"movie\" value=\"http://www.youtube.com/v/6-pWi6_ajDY&amp;hl=en&amp;fs=1&amp;ap=%2526fmt%3D22\" /><param name=\"allowFullScreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><embed allowfullscreen=\"true\" allowscriptaccess=\"always\" height=\"400\" src=\"http://www.youtube.com/v/6-pWi6_ajDY&amp;hl=en&amp;fs=1&amp;ap=%2526fmt%3D22\" type=\"application/x-shockwave-flash\" width=\"711\"></embed></object></p>\r\n<p>\r\n	<br />\r\n	<object height=\"400\" width=\"711\"><param name=\"movie\" value=\"http://www.youtube.com/v/_dZIBQiHFUE&amp;hl=en&amp;fs=1&amp;ap=%2526fmt%3D22\" /><param name=\"allowFullScreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><embed allowfullscreen=\"true\" allowscriptaccess=\"always\" height=\"400\" src=\"http://www.youtube.com/v/_dZIBQiHFUE&amp;hl=en&amp;fs=1&amp;ap=%2526fmt%3D22\" type=\"application/x-shockwave-flash\" width=\"711\"></embed></object></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh6.ggpht.com/_Njaf48TXR0g/S-ztLEv9sJI/AAAAAAAAA2k/1yuxmD5Ap0k/s912/StartToTopOfFalls.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh6.ggpht.com/_Njaf48TXR0g/S-ztBW5Qw0I/AAAAAAAAA10/RCwjQoafjtc/s912/AmiToNimblewillChurchProfile.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh6.ggpht.com/_Njaf48TXR0g/S-ztBVF0MSI/AAAAAAAAA14/xd-2OLfVgxY/s912/BullMtSkippingCP7.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh4.ggpht.com/_Njaf48TXR0g/S-ztBjrpGwI/AAAAAAAAA18/dzyKNvpTDQ0/s912/BullMtSkippingCP8.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh4.ggpht.com/_Njaf48TXR0g/S-ztB9SIj1I/AAAAAAAAA2A/LV-5AmZlH0Y/s912/BullMtSkippingCP10.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh5.ggpht.com/_Njaf48TXR0g/S-ztKWOnfyI/AAAAAAAAA2Y/lOxCKRuaqfk/s912/NimblewillChurchToCanoePutInProfile.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh4.ggpht.com/_Njaf48TXR0g/S-ztGTJCgHI/AAAAAAAAA2Q/2iFHRgVVRWg/s912/EtowahRiverHwy9toHwy9.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh3.ggpht.com/_Njaf48TXR0g/S-ztGVUR5cI/AAAAAAAAA2M/iKX9u_cQEhc/s912/CanoeTakeoutToDawsonForestParking.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	<span style=\"font-size: 36px;\"><u><strong>Reality Bikes Stage Two</strong><br />\r\n	</u></span></p>\r\n<p>\r\n	<br />\r\n	Navigators will now be challenged with the &quot;Radiation Sickness&quot;.&nbsp; Not only will they have to plot new checkpoints after 14 hours of racing, but some of the checkpoints will require advanced navigation skills to plot, such as projecting waypoints from a location and triangulation.&nbsp; This will really test their ability to think clearly.<br />\r\n	&nbsp;<br />\r\n	The Reality Bike stage starts at midnight on foot.&nbsp; Some racers will have actually taken naps, while others may barely have enough time to plot their coordinates, and still others will be debating calling it quits.&nbsp; The teams that decide to continue will make their way north to the Amicalola Creek Parking area, picking up two checkpoints along the way.&nbsp; They can choose to wade the Etowah river (waist deep) and cut off a mile of the trek, or take the Shoal Creek bridge and cross Shoal Creek (ankle to knee deep).&nbsp; Either way, they will need to find two checkpoints along the way.&nbsp; One, a hidden waterfall, which will be quite hard to find in the dark, and the other, a tapped spring, which could be a good place to refill their bladders (still recommend treating this water).<br />\r\n	&nbsp;<br />\r\n	Upon reaching the Amicalola Creek Parking area on Hwy 53, they will pick up their bikes and pass a safety gear check before starting the 16.5 mile bike to almost the top of Burnt Mountain, requiring 2700 feet of elevation gain.&nbsp; This climb will be painful, with several teams probably deciding to push their bikes.<br />\r\n	&nbsp;<br />\r\n	At the top of the ride, they will transition to foot, having the option to hit the ropes course now, or later during this trekking section.&nbsp; The ropes course consists of an ascention into the trees, followed by a rappel back down.&nbsp; Only one team member will enjoy this challenge.&nbsp; They will also have to find the four checkpoints they plotted, which could be a short 4 mile route with 1100 feet of elevation gain, or much longer, if they plotted incorrectly.<br />\r\n	&nbsp;<br />\r\n	Back at the transition area, they will pick up their bikes and fly back down the mountain road, back to Amicalola Falls State Park, where they will discover the &quot;mystery finish&quot;.&nbsp; Some, who raced last year or read the reviews, will be hoping the finish is not the same...&nbsp; Well, we like traditions, and this year, they will end the same way, with the full 604 stairs to the top of the falls, where their epic journey will end.</p>\r\n<p>\r\n	<br />\r\n	<object height=\"400\" width=\"711\"><param name=\"movie\" value=\"http://www.youtube.com/v/Nvqaindr0Yc&amp;hl=en&amp;fs=1&amp;ap=%2526fmt%3D22\" /><param name=\"allowFullScreen\" value=\"true\" /><param name=\"allowscriptaccess\" value=\"always\" /><embed allowfullscreen=\"true\" allowscriptaccess=\"always\" height=\"400\" src=\"http://www.youtube.com/v/Nvqaindr0Yc&amp;hl=en&amp;fs=1&amp;ap=%2526fmt%3D22\" type=\"application/x-shockwave-flash\" width=\"711\"></embed></object></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh4.ggpht.com/_Njaf48TXR0g/S-ztKqB11NI/AAAAAAAAA2g/K9lEecoo8GA/Stage2StartToAmiCrParkSwim.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh3.ggpht.com/_Njaf48TXR0g/S-ztKpCwAyI/AAAAAAAAA2c/cZJoUTxhObI/Stage2StartToAmiCrParkNoSwim.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh3.ggpht.com/_Njaf48TXR0g/S-ztBOB6kMI/AAAAAAAAA1w/pW_rLaRWRB4/AmiCrParkToBurntMtBike.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh6.ggpht.com/_Njaf48TXR0g/S-ztGG1NMmI/AAAAAAAAA2I/e8wEkGz2VUI/BurntMtTrek.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh5.ggpht.com/_Njaf48TXR0g/S-ztGCQEMYI/AAAAAAAAA2E/ibs0h8BFUdU/BurntMtToAmicalolaFallsBike.JPG\" style=\"width: 750px;\" /></p>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	<img alt=\"\" src=\"http://lh3.ggpht.com/_Njaf48TXR0g/S-ztGawxZtI/AAAAAAAAA2U/vfZFOG2eSHU/MysteryFinish.JPG\" style=\"width: 750px;\" /></p>\r\n','16066','default','AtomicAdventureRaceFeedMix','AtomicAdventureRaceBlog','AtomicAdventureRacePhotos','AtomicAdventureRaceVideos','AtomicAdventureRaceAudio','no'),(277,276,'8-Hour Course','modifiedrogaine',8,0,'','10895','default','GoldrushAdventureRaceFeedMix','GoldrushAdventureRaceBlog','GoldRushAdventureRacePhotos','default','GoldrushAdventureRaceAudio','no'),(278,276,'12-Hour Course','modifiedrogaine',12,0,'','10895','default','GoldrushAdventureRaceFeedMix','GoldrushAdventureRaceBlog','GoldRushAdventureRacePhotos','default','GoldrushAdventureRaceAudio','no'),(279,276,'24-Hour Course','modifiedrogaine',24,0,'','10895','default','GoldrushAdventureRaceFeedMix','GoldrushAdventureRaceBlog','GoldRushAdventureRacePhotos','default','GoldrushAdventureRaceAudio','no');
